                        return new Tuple2<>(query, false);
                    } else {
                        // Query in cache, mark as cache hit
                        queryCache.put(query, currentTime);
                        return new Tuple2<>(query, true);
                    }
                } else {
                    // Query not in top frequent queries, mark as cache miss
                    return new Tuple2<>(query, false);
                }
            }
        });

        // Calculate the hit rate
        double hitCount = hitStatusRDD.filter(tuple -> tuple._2).count();
        double totalCount = hitStatusRDD.count();
        double hitRate = hitCount / totalCount;

        System.out.println("Hit Rate: " + hitRate);

        // Stop the SparkContext
        sc.stop();
    }
